import Link from "next/link";
import React from 'react'

export default class Navbar extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      isHome: true
    };
    this.handleHome = this.handleHome.bind(this);
    this.handleContact = this.handleContact.bind(this);
  }
  render() {
    return (
      <header>
        <nav className="navbar mr-auto navbar-expand-lg navbar-light bg-transparent">

          <Link onClick={this.handleHome} href="/">
            <a className="navbar-brand" >
              <img
                src={logo}
                width="70"
                alt="DatBig Logo"
                className="DatBigLogo"
              ></img>
            </a>
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-toggle="collapse"
            data-target="#navbarsExampleDefault"
            aria-controls="navbarsExampleDefault"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon" />
          </button>

          <div
            className="collapse navbar-collapse mr-3"
            id="navbarsExampleDefault"
          >
            <ul className="navbar-nav ml-auto">
              {this.state.isHome === true  ? (<li className="nav-item active">
                <a className="nav-link" data-scroll href="#solutions">
                  Soluciones
                </a>
              </li>): (<li className="nav-item active">
                <Link onClick={this.handleHome} href="/">
                  <a className="nav-link" data-scroll >
                    Home
                  </a>
                </Link>
              </li>)}
              <li className="nav-item">
                <Link className="" onClick={this.handleContact} href="/contact">
                  <a className="contacButtom nav-link" >
                    Contact us
                  </a>
                </Link>
              </li>
            </ul>
          </div>
        </nav>
      </header>
    );
  }

  handleContact() {
    this.setState({ isHome: false });
  }

  handleHome() {
    this.setState({ isHome: true });
  }
}
